import styled from "styled-components"


export const Header = styled.div`
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
`;

export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 436px;
    left: 0px;
    top: 0px;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const Container1 = styled.div`
    position: absolute;
    width: 60px;
    height: 80px;
    left: 195px;
    top: 139px;
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 10px;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 60px;
    height: 80px;
    left: 270px;
    top: 139px;
    background: #F7F8F8;
    border-radius: 10px;
`;

