    position: absolute;
    width: 60px;
    height: 80px;
    left: -30px;
    top: 139px;
    background: #F7F8F8;
    border-radius: 10px;
`;

export const Text1 = styled.text`
    position: absolute;
    width: 15px;
    height: 21px;
    left: 218px;
    top: 154px;
    font-family: 'Inter';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 21px;
    color: #FFFFFF;
`;

